import React, { Component } from "react";
import "./App.css";
import { Button } from "react-bootstrap";

class App extends Component {
  constructor(props) {
    super(props);
    this.state = {
      count: 0
    }
  }
  render() {
    return <div className="App">
      <Button variant="success">+</Button>
      <Button>-</Button>
    </div>;
  }
}
export default App;
